pragma solidity >=0.6.0;

import "./Base.sol";

contract Farmer is Base {
    //Fields
    address farmerAddress;
    uint8 zipCode;
    mapping(uint256 => Cow) farmerCows;
    mapping(address => string) happyConsumers;

    //Methods:
    function raiseCow(uint256 _cowId) onlyFarmer public {
        Cow storage cow;
        cow.isMeat = false;
        cow.state = State.Raised;
        cow.cowId = _cowId;
        cow.farmer = msg.sender;
        cow.currentLocation = msg.sender;
        cows[cow.cowId] = cow;
        farmerCows[cow.cowId] = cow;
    }
    function putCowUpForSale(uint256 cowId) onlyFarmer public {

    }
    function transportCow(uint256 cowId) onlyFarmer public {

    }
}
